import React, { useState } from 'react';
import './App.css';
import { DropdownButton, Dropdown, Nav, Offcanvas } from 'react-bootstrap';

function NavBar() {
  return (
    <Dropdown >
      <DropdownButton variant="light" align="end" title="menu" id="dropdown-menu-align-end">
        <Dropdown.Item eventKey="1"><a href="/">Home</a></Dropdown.Item>
        <Dropdown.Divider />

        <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
        <Dropdown.Item eventKey="3">Something else here</Dropdown.Item>
        <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
      </DropdownButton>
    </Dropdown>
  );
}

export default NavBar
